'use strict';
class InternalOffersProvider {
    manager;
    offersCalculator;
    static create(manager, offersCalculator) {
        let result;
        result = new InternalOffersProvider();
        result.manager = manager;
        result.offersCalculator = offersCalculator;
        return result;
    }
    getCalculatedOfferById(offerId) {
        return this.manager.getOfferById(offerId);
    }
    getInternalOfferById(offerId) {
        return this.manager.getInternalOfferById(offerId);
    }
    calculateBidAsk(offer) {
        return this.offersCalculator.calculateBidAsk(offer);
    }
    getState() {
        return this.manager.getState();
    }
}
module.exports = InternalOffersProvider
